def is_double(potential_double):
    return check_for_duplicates(potential_double, 2)


def is_triple(potential_triple):
    return check_for_duplicates(potential_triple, 3)


def increment_count(chars, character):
    if character in chars.keys():
        # first instance, add to dictionary
        chars[character] = chars[character] + 1
    else:
        chars[character] = 1


def check_for_duplicates(potential_duplicates, duplicate_number):
    count_of_duplicates = {}
    has_specified_number_of_duplicates = False
    for c in potential_duplicates:
        increment_count(count_of_duplicates, c)
    for character in count_of_duplicates:
        if count_of_duplicates[character] == duplicate_number:
            has_specified_number_of_duplicates = True
    return has_specified_number_of_duplicates


